import React from 'react'
import { eventslist } from '../constantData/dummyData'

const EventsPage = () => {
  return (
   <div>
     <h1>Events</h1>
     <ul>
       {eventslist.map((event) => (
         <li key={event.id}>
           <h2>{event.name}</h2>
           <p>Date: {event.date}</p>
           <p>Location: {event.location}</p>
           <p>Description: {event.description}</p>
         </li>
       ))}
     </ul>
   
   </div>
  )
}

export default EventsPage
